window.bookSummaryJSON = "<p>Eleanor, the charming manager of a cozy tea shop, enjoys the transportive ritual of making a cup of Masala Chai tea, reminisces about the tea's origins, and delights in the beauty of her quaint English village during the holidays. </p> <p>Bedtime stories are narrated by the world's most celebrated voices and written with no beginning, middle, or end so you don't stay up to hear what happens next. They're interesting enough to give your mind something to focus on, but delivered in a way that encourages sleep. </p> <p>This title is part of The Audible Sleep Collection, exclusive audio experiences created to help you fall asleep, stay asleep, and wake up in the right morning mindset. New and free for members.</p>"; 
